package week1.day3;

public class PrimeNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for (int i = 1; i <=5; i++) {
			
			if(i==3) {
				
				System.out.println("Three");
				
				continue;
			}
			
			System.out.println(i);
		}

	}

}
